// Filename - Details.jsx
import React from "react"

export default function Details(props) {
    function findSelected(objArray) {
        for (let i = 0; i < objArray.length; i++) {
            if (objArray[i].isSelected) {
                return objArray[i]
            }
        }
    }
    function readTextFile(file) {
        fetch(file)
            .then(response => response.text())
            .then(data => {
                // Store the text content in a variable
                const textContent = data;
                console.log(textContent); // Output the text content to the console

                // You can use the textContent variable for further processing here
            })
            .catch(error => console.error('Error fetching the text file:', error));
    }

    const selected = findSelected(props.objects)
    readTextFile(`../stories/${selected.story}`)
    return (
        <div className="details">
            <img 
                className="details--image"
                src={require(`../images/${selected.url}`)} 
                alt={selected.label} 
            />
            {/* <p>{textContent}</p> */}
        </div>
    )
}
